import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
import Person from "@material-ui/icons/Person";
import EmojiObjectsIcon from '@material-ui/icons/EmojiObjects';
import Favorite from "@material-ui/icons/Favorite";
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import Button from "components/CustomButtons/Button.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import NavPills from "components/NavPills/NavPills.js";
import Parallax from "components/Parallax/Parallax.js";

import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';

import styles from "assets/jss/material-kit-react/views/resultsPage/resultsStyle.js";

const useStyles = makeStyles(styles);

export default function ProfilePage(props) {
  const classes = useStyles();
  const { ...rest } = props;
  const imageClasses = classNames(
    classes.imgRaised,
    classes.imgRoundedCircle,
    classes.imgFluid
  );
  const navImageClasses = classNames(classes.imgRounded, classes.imgGallery);
  return (
    <div>
      <Header
        color="transparent"
        brand="Material Kit React"
        rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 200,
          color: "white"
        }}
        {...rest}
      />
      <Parallax small filter image={require("assets/img/profile-bg.jpg")} />
      <div className={classNames(classes.main, classes.mainRaised)}>
        <div>
          <div className={classes.container}>
            <h2 className={classes.title}>Your Results:</h2>
            <GridContainer justify="center">
              <GridItem xs={12} sm={12} md={8} className={classes.navWrapper}>
                <NavPills
                  alignCenter
                  color="rose"
                  tabs={[
                    {
                      tabButton: "Type",
                      tabIcon: Person,
                      tabContent: (
                        <>
                        <h2>You're gift recieving type is <b>INTP</b></h2>
                        <p className={classes.typeDescription}>
                          INTP gift recievers are intuitive, rational problem solvers who love a good challenge.
                          While they might not be the life of the party, they do love enjoying time with close friends
                          in more personal situations. Great gift ideas include puzzles, new technology, or just something
                          to tinker with.
                        </p>
                        </>
                      )
                    },
                    {
                      tabButton: "Gift Ideas",
                      tabIcon: EmojiObjectsIcon,
                      tabContent: (
                        <div className={classes.root}>
                        <Paper className={classes.paper}>
                          <Grid container spacing={2}>
                            <Grid item>
                              <ButtonBase className={classes.image}>
                                <img className={classes.img} alt="complex" src="/static/images/grid/complex.jpg" />
                              </ButtonBase>
                            </Grid>
                            <Grid item xs={12} sm container>
                              <Grid item xs container direction="column" spacing={2}>
                                <Grid item xs>
                                  <Typography gutterBottom variant="subtitle1">
                                    Standard license
                                  </Typography>
                                  <Typography variant="body2" gutterBottom>
                                    Full resolution 1920x1080 â€¢ JPEG
                                  </Typography>
                                  <Typography variant="body2" color="textSecondary">
                                    ID: 1030114
                                  </Typography>
                                </Grid>
                                <Grid item>
                                  <Typography variant="body2" style={{ cursor: 'pointer' }}>
                                    Remove
                                  </Typography>
                                </Grid>
                              </Grid>
                              <Grid item>
                                <Typography variant="subtitle1">$19.00</Typography>
                              </Grid>
                            </Grid>
                          </Grid>
                        </Paper>
                      </div>
                      )
                    }
                  ]}
                />
              </GridItem>
            </GridContainer>
            <h3>Share your results!</h3>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}
